    <section class="bg-neutral-100 h-full text-center grid grid-rows-2">
      <div class="grid"></div>
      <div class="flex flex-col justify-center items-center">
        <div class="w-1/3">
          <div class="container-lg mb-6">
            <h1 class="mb-5 font-bold text-2xl leading-10">Hasta el<br></br>
            <strong class="text-[64px] text-[#D62744]">70%</strong><br></br>
            DE DESCUENTO
            </h1>
            
          </div>
          <div class="flex flex-row items-center justify-center mb-20">
            <BtnFlat>Ver ofertas</BtnFlat>
          </div>
        </div>
      </div>
    </section>
  );
};
